import React from "react";
import classes from './LocationSec.module.css';

const LocationSec = (props) => {
    
    const table = (
        <table>
            {Object.entries(props.timetable)}
        </table>
        
    );
    return (
        <div className={classes.LocationSec}>
            
            <h1>{props.name}</h1>
            <p>{props.location===undefined ? 'Use Phone/Laptop for Video Call' : `Location: ${props.location}`} </p>
            <p>Fees: {props.fees}</p>
            
            
        </div>
    );
}

export default LocationSec;
